import React, { useState, useEffect } from 'react';
import { facultyAPI } from '../../services/api';
import Header from '../common/Header';
import SentimentChart from './SentimentChart';
import FeedbackList from './FeedbackList';
import LoadingSpinner from '../common/LoadingSpinner';

const FacultyDashboard = ({ facultyName, onLogout }) => {
  const [dashboardData, setDashboardData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchDashboardData();
  }, [facultyName]);

  const fetchDashboardData = async () => {
    try {
      setLoading(true);
      const response = await facultyAPI.getDashboard(facultyName);
      setDashboardData(response.data);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
      setError('Error loading dashboard data');
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return <LoadingSpinner message="Loading dashboard..." />;
  }

  if (error) {
    return (
      <div className="container mt-4">
        <div className="alert alert-danger">{error}</div>
      </div>
    );
  }

  return (
    <div>
      <Header 
        title={`Faculty Dashboard - ${facultyName}`} 
        userRole="Faculty" 
        onLogout={onLogout} 
      />
      
      <div className="container">
        {/* Stats Cards */}
        <div className="row mb-4">
          <div className="col-md-3">
            <div className="card bg-primary text-white">
              <div className="card-body text-center">
                <h3>{dashboardData.stats.total}</h3>
                <p className="mb-0">Total Feedback</p>
              </div>
            </div>
          </div>
          <div className="col-md-3">
            <div className="card bg-success text-white">
              <div className="card-body text-center">
                <h3>{dashboardData.stats.positive}</h3>
                <p className="mb-0">Positive</p>
              </div>
            </div>
          </div>
          <div className="col-md-3">
            <div className="card bg-warning text-white">
              <div className="card-body text-center">
                <h3>{dashboardData.stats.neutral}</h3>
                <p className="mb-0">Neutral</p>
              </div>
            </div>
          </div>
          <div className="col-md-3">
            <div className="card bg-info text-white">
              <div className="card-body text-center">
                <h3>{dashboardData.stats.averageRating.toFixed(1)}</h3>
                <p className="mb-0">Avg Rating</p>
              </div>
            </div>
          </div>
        </div>

        {/* Charts and Feedback */}
        <div className="row">
          <div className="col-md-4">
            <SentimentChart stats={dashboardData.stats} />
          </div>
          <div className="col-md-8">
            <FeedbackList feedback={dashboardData.feedback} />
          </div>
        </div>
      </div>
    </div>
  );
};

export default FacultyDashboard;
